import logo from "./logo.svg";
import { Button } from "antd";
import UserForm from "./components/UserForm";
import { Steps,Row } from "antd";
import {
  UserOutlined,
  SolutionOutlined,
  LoadingOutlined,
  ColumnHeightOutlined,
  SmileOutlined,
  GitlabOutlined
} from "@ant-design/icons";

import "./App.css";
const { Step } = Steps;

function App() {
  return (
    <div>
        <Row type="flex" justify="center" align="middle" style={{minHeight: '20vh', margin:"20px", justifyContent:"center",alignItems: "center", display:"flex"}}>
        <Steps>
          <Step status="finish" title="Login" icon={<UserOutlined />} />
          <Step
            status="finish"
            title="Select  Fit"
            icon={<SolutionOutlined />}
          />
          <Step
            status="finish"
            title="Select Inseam"
            icon={<ColumnHeightOutlined /> }
          />
          <Step
            status="finish"
            title="Select Wash"
            icon={<SolutionOutlined />}
          />
          <Step
            status="finish"
            title="Select Fabric"
            icon={<SolutionOutlined />}
          />
          <Step
            status="finish"
            title="Select Hardware"
            icon={<SolutionOutlined />}
          />
          <Step
            status="finish"
            title="Select Sticching"
            icon={<GitlabOutlined />}
          />
          <Step
            status="finish"
            title="Select Hem"
            icon={<SolutionOutlined />}
          />
          <Step status="process" title="Additional Notes" icon={<SolutionOutlined />} />
          <Step status="wait" title="Submit" icon={<SmileOutlined />} />
        </Steps>
      </Row>
      <UserForm />
    </div>
  );
}

export default App;
